import React,{useState,useEffect} from 'react';

import {getWeather} from "./Api/GetWeather";


function App() {
    const [weatherInfo,setWeather] = useState();
    const [findCity,setCity] = useState('');
    const [img,setImg] = useState();

    useEffect(()=>{
        switch (weatherInfo){
            case 'Rain':
                setImg('data:image/jpeg;base64,');
                console.log(img);
                break;
            case 'Snow':
                setImg('data:image/jpeg;base64,');
                console.log(img);
                break;
            case 'Clear':
                setImg('data:image/jpeg;base64,');
                console.log(img);
                break;
            case 'Haze':
                setImg('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR3Rqj2wUL-Y4mtjqgLCGOgZIOE56oYYONB_A&usqp=CAU');
                console.log(img);
                break;
        }
    },[weatherInfo])


    const cityValue = e => {
        setCity(e.target.value);
    }

  return (
    <>
      <input onChange={cityValue}/>
      <button onClick={async ()=>{
          const cityWeather = await getWeather(findCity);
          await setWeather(cityWeather);

      }}>Search</button>
        <div style={{
            width:"100%",
            height:"100vh",
            backgroundRepeat: 'no-repeat',
            backgroundImage: "url(" + {img} + ")",
            backgroundPosition: 'center',
            backgroundSize: 'cover'}}></div>
        <p style={{
            color : 'white'
        }}>{weatherInfo}</p>
    </>
  );
}

export default App;
